import React, { useState,useEffect } from "react";

export const GoalList = () => {
  const [goalList, setGoalList] = useState({});

      useEffect(
         () => {
            fetch(`http://localhost:8088/goals`)
            .then(res => res.json())
            .then((data) => {
               setGoalList(data)
            })
         }, []
      )



  return (
     <>
     <h1>Goal List</h1>

      {
         goalList.map((goal) => {
            <div>
               {goal.goalDescription} {goal.goalObjective} {goal.goalNotes}
            </div>
         })
      }


    </>
  );
};
